import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Menu from "./components/Menu";
import SingleQR from "./components/SingleQR";
import AdminLogin from "./components/AdminLogin";
import AdminDashboard from "./components/AdminDashboard";

function App() {
  return (
    <Router>
      <Routes>
        {/* Customer Pages */}
        <Route path="/" element={<SingleQR />} />  {/* Single QR â†’ asks table no */}
        <Route path="/menu" element={<Menu />} />   {/* Menu page after selecting table */}

        {/* Admin Pages */}
        <Route path="/admin" element={<AdminLogin />} />   {/* Login first */}
        <Route path="/admin/dashboard" element={<AdminDashboard />} /> {/* Dashboard after login */}

        {/* Fallback route: if user enters unknown path */}
        <Route path="*" element={<SingleQR />} />
      </Routes>
    </Router>
  );
}

export default App;
